import React, { Component } from 'react'
import SideNav from './../../navbar/SideNav'
import TopNav from './../../navbar/Topnav'

class Admin extends Component {
    render() {
        return (
            <div>
                <TopNav/>
                <SideNav/>
            </div>
        )
    }
}

export default Admin
